import React from 'react';

class Data extends React.Component {
    constructor() {
        super();
        this.state = 
        {
            data: [],
        }
    }

 componentDidMount() {
     fetch('/getProspectData')
     .then(response => response.json())
     .then(data => this.setState({ data })); 
     };

renderTableData() {
        return this.state.data.map((prospect, index) => {
           const { id, name, email, phone, caseType, comments, notes, status, createdAt } = prospect//destructuring
           return (
              <tr key={id}>
                 <td>{id}</td>
                 <td>{name}</td>
                 <td>{email}</td>
                 <td>{phone}</td>
                 <td>{caseType}</td>
                 <td>{comments}</td>
                 <td>{notes}</td>
                 <td>{status}</td>
                 <td>{createdAt}</td>
              </tr>
           )
        })
     }

render() { 
    const clients = (this.state.data)
    return (
        <p> {JSON.stringify(clients)}</p>
    )
}
};

export default Data;
